
CREATE TABLE public.earthquakes (
                                    "time" timestamp without time zone,
                                    latitude numeric,
                                    longitude numeric,
                                    depth numeric,
                                    mag numeric,
                                    magtype character varying,
                                    gap numeric,
                                    dmin numeric,
                                    rms numeric,
                                    "horizontalError" numeric,
                                    "depthError" numeric,
                                    "magError" numeric
);




